import React,{Component} from "react";

class Button extends Component{
    user="Yehuda"
    clickMe = () =>{
        console.log("btn clicked");
        this.user ="David";
        this.forceUpdate();
        
    }

  render(){
    return(
      <div>
        Button work
        <button onClick={this.clickMe}>click me</button>
      </div>
    
    )
  }
}

export default Button;
